INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(1, 'Spy x Family เล่ม 1', 'TATSUYA ENDO', 'SPY X FAMILY เล่ม 1\r\nสุดยอดสปาย (สนธยา) ได้รับคำสั่งให้สร้าง \"ครอบครัว\" เพื่อลอบเข้าไปในโรงเรียนชื่อดัง แต่ \"ลูกสาว\" ที่เขาได้พบดันเป็นผู้มีพลังจิตอ่านใจคน! \"ภรรยา\" เป็นมือสังหาร!? โฮมคอเมดี้สุดฮาของครอบครัวปลอมๆ ที่ต่างฝ่ายต่างปกปิดตัวจริงของกันและกัน ที่ต้องเผชิญหน้ากับการสอบเข้าและปกป้องโลก', 'Manga', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(2, 'Spy x Family เล่ม 2', 'TATSUYA ENDO', 'SPY X FAMILY เล่ม 2\r\nตระกูลฟอเจอร์สอบเข้าเรียนโรงเรียนดัง เพื่อทำภารกิจปกป้องความสงบสุขระหว่างออสทาเนียและเวสทาลิส แต่เพื่อเข้าใกล้เป้าหมายเดสมอนด์ อาเนียจะต้องเป็นนักเรียนดีเด่นให้ได้!! สนธยาจึงเริ่มปฏิบัติการ \"แผนตีสนิทชิดเชื้อ\"...!?', 'Manga', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(3, 'Spy x Family เล่ม 3', 'TATSUYA ENDO', 'SPY X FAMILY เล่ม 3\r\nยูริ น้องชายของยอร์ มาเยือนบ้านฟอเจอร์!! สนธยาและยูริต่างปิดบังจริงของตัวเองที่เป็นสปาย และตำรวจลับเข้าล้วงความลับกันอย่างดุเดือดแล้วยูริผู้รักและเทิดทูนพี่สาว ก็ได้บอกให้สนธยาพิสูจน์ว่าทั้งสองเป็นคู่รักกันจริงๆ', 'Manga', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(4, 'Spy x Family เล่ม 4', 'TATSUYA ENDO', 'SPY X FAMILY เล่ม 4\r\nผู้ก่อการร้ายคิดจะใช้หมาติดระเบิดลอบสังหารรัฐมนตรีของเวสทาลิส! ทั้งครอบครัวได้ออกมาหาหมาให้อาเนียเลี้ยงแต่สนธยาก็ต้องเข้าร่วมภารกิจด่วนเพื่อหยุดผู้ก่อการร้าย...!! ส่วนทางอาเนียก็ได้พบกับหมาปริศนา ที่รู้จักครอบครัวฟอเจอร์ได้ยังไงก็ไม่รู้...!?', 'Manga', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(5, 'Spy x Family เล่ม 5', 'TATSUYA ENDO', 'SPY X FAMILY เล่ม 5\r\nเมื่อรับบอนด์สุนัขผู้หยั่งรู้อนาคต เข้ามาเป็นสมาชิกใหม่ก็ดูเหมือนโอเปอเรชั่น STRIX และชีวิตครอบครัวจะไปได้สวย---แต่อาเนียก็ต้องมาตกที่นั่งลำบากเมื่อต้องเจอกับสอบประเมินผลกลางภาค!? การสอบที่มีสเตล่าและโทนิโท่เป็นเดิมพันจะออกมาเป็นเช่นไร...!!', 'Manga', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(6, 'Spy x Family เล่ม 6', 'TATSUYA ENDO', 'SPY X FAMILY เล่ม 6\r\nเพื่อตามหาเบาะแสของเอกสารลับจากยุคสงคราม สนธยากับย่ำค่ำจึงเข้าร่วมการแข่งขันเทนนิสใต้ดิน!! แต่คู่สามีภรรยาครอบครัวฟอเจอร์กลับถึงคราววิกฤติเพราะย่ำค่ำเห็นว่าตัวเองเหมาะกับบทภรรยาของลอยด์มากกว่า...!?\r\n', 'Manga', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(7, 'Spy x Family เล่ม 7', 'TATSUYA ENDO', 'SPY X FAMILY เล่ม 7\r\nในที่สุดสนธยาก็ได้พบกับเดลมอนด์เป็นครั้งแรกด้วยการเข้าไปแทรกการสนทนาระหว่างเดสมอนด์และดาเมียน ลูกชายคนรอง!!สนธยาพยายามชวนเป้าหมายคุยเพื่อดูว่าอีกฝ่ายเป็นคนอย่างไรแต่...!?', 'Manga', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(8, 'Spy x Family เล่ม 8', 'TATSUYA ENDO', 'SPY x FAMILY เล่ม 8\r\nยอร์ได้ขึ้นเรือสำราญเพื่อคุ้มกันมาเฟียตามภารกิจที่ได้รับมอบหมายจาก \"การ์เด้น\" องค์กรลับของออสทาเนีย!และ เมื่อมีลอยด์กับอาเนียกำลังพักผ่อนอยู่บนเรือ ยอร์ก็เริ่มลังเลที่จะทำงานเบื้องหลังขึ้นมาซะแล้ว!?', 'Manga', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(9, '100 คำถาม ทายได้เก่งสุดๆ เกรียนเรียกพี่', 'ศรัณย์ กิจสิริไพศาล,บุหลัน จิตวงศ์', 'ที่สุดของคำถามกวน ๆ ที่คุณต้องร้องโอ้ย! คัดสรรสุดยอดคำถามที่จะทำให้คุณและเพื่อน ๆ ฟิลและอินแบบฮา ๆ ช่วยเพิ่มสีสันและความสดใสให้ชีวิต ไม่ว่าจะอยู่ที่ไหน อยู่กับใคร หรือทำอะไร ก็สามารถหยิบคำถามกวน ๆ ชวนหัวเราะจนแก้มปริมาทายเล่นได้ รับรองว่าคุณจะมีแต่ความสุข หายเครียด หายเหงา หายเศร้า หายซึม ถ้าพร้อมแล้วจะรออะไร ไปเริ่มฮากันเลยดีกว่า!', 'For Kid', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(10, '100 คำถาม ระเบิดความบ้า ฮา เหงือกแห้ง', 'บก. ณัฐวัฒน์ กวีธีรรัตน์', ' \"100 คำถามอะไรเอ่ย ฉบับ ระเบิดความบ้า ฮาเหงือกแห้ง\" เล่มนี้ ได้คัดสรรสุดยอดคำถามกวน ๆ ที่จะทำให้คุณหัวเราะจนแก้มปริ แล้วคุณจะได้รู้ว่าบนโลกใบนี้ยังมีเรื่องสนุก ๆ อีกมากมาย ที่จะทำให้ชีวิตของคุณมีสีสันและสดใสได้ในทุกวัน ๆ วัน ไม่ว่าจะไปที่ไหน ทำอะไร หรืออยู่กับใคร ก็สามารถหยิบคำถามอะไรเอ่ยมาทายเล่นได้ รับรองว่าความเครียด ความเศร้า และความเหงาจะหายไปในพริบตา จะฮาเดี่ยว ฮาคู่ หรือฮายกก๊วน จะฮาแบบไหน', 'For Kid', );
