INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(14, 'VACCINE+ หลักศูตรใหม่ สสวท.', 'ณัฐ อุดมพาณิชย์', 'หนังสือเล่มนี้รวบรวมข้อสอบดีๆ จากหลายสนามสอบ โดยเฉพาะแนวข้อสอบ PAT 1 และ 9 วิชาสามัญล่าสุด เพื่อให้ผู้อ่านได้แก้ปัญหาที่แตกต่างออกไปจากโจทย์เดิมๆ ที่เคยเจอมาแล้ว และช่วยเปิดมุมมองการคิด วิเคราะห์ มีโอกาสได้ฝึกการแก้ปัญหาด้วยวิธีที่ฉีกแนวจากวิธีทั่วไปที่เคยทำ อันจะช่วยเสริมสร้างทักษะและเพิ่มประสบการณ์การทำโจทย์ เหมาะสำหรับใช้เตรียมตัวสอบ PAT 1 : ความถนัดทางคณิตศาสตร์ สอบเคลียริ่งเฮาส์ 9 วิชาสามัญเพื่อเข้าหมอ กสพท. และสอบตรงทุกคณะ ทุกวิทยาลัย', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(15, 'BIOLOGY The problems book ', 'ศุภณัฐ ไพโรหกุล', 'ปัจจุบันการเรียนวิชาชีววิทยาสำหรับการสอบประจำภาค การสอบเข้ามหาวิทยาลัย การสอบแข่งขันต่างๆ ทั้งในระดับโอลิมปิกวิชาการและการแข่งขันสอบชิงทุนต่างๆ ข้อสอบมีการวัดและประเมินทักษะที่นอกเหนือไปจากการท่องจำ เนื้อหาต่างๆ ขึ้นไปในระดับที่มีการคิดวิเคราะห์ สังเคราะห์ และการแก้ปัญหาโจทย์ที่มีความซับซ้อนมากขึ้น ดังนั้นทางคณะผู้เขียนจึงทำการจัดทำ หนังสือ Biology: The Problems Book ขึ้นมา เพื่อให้ผู้อ่านสามารถนำความรู้ที่ได้จากการเรียนในห้องเรียน หรือการอ่านหนังสือทบทวนมาใช้ในการวิเคราะห์โจทย์ปัญหาที่มีความซับซ้อนเพิ่มขึ้น โดยโจทย์ในหนังสือเล่มนี้ส่วนใหญ่จะเน้นไปที่การคิดวิเคราะห์ เพื่อให้นักเรียนสามารถต่อยอดความรู้ที่ได้ไปอย่างมีประสิทธิภาพเพิ่มขึ้น', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(16, 'เตรียมสอบความถนัดแพทย์ ฉบับติวสอบกสพท.', 'ปาณัสม์ ชูชีพวัฒนา', 'เตรียมสอบความถนัดแพทย์ ฉบับติวพร้อมสอบ กสพท. คู่มือสรุปเนื้อหาเพื่อเตรียมความพร้อมสำหรับผู้เข้าสอบความถนัดทางแพทย์ เขียนโดยผู้มีประสบการณ์จากสนามสอบตัวจริง พร้อมแนะเทคนิคการทำข้อสอบให้ได้คะแนนสูงในเวลาจำกัด', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(17, 'จับตาย วายร้าย GAT & ADMISSION GRAMMAR', 'อ.ศิริ จูเนียร์', 'ติวเข้มหลัก \"Grammar\" ครบทุกหัวข้อ ไม่ว่าจะเป็น Word Building & Word Forms, Parts of Speech, Sentence Structures, Verb & Subject Agreement, Conditional Sentences, Tenses และ Active and Passive Voices ด้วยเทคนิคการจำสูตรลับ Grammar ขั้นเทพ พร้อมแบบฝึกหัดทบทวนทีละหัวข้อ ตะลุยโจทย์ตรงแนวข้อสอบย้อนหลัง 10 ปี กว่า 1,500 ข้อ เพื่อทำเกรดในโรงเรียน และเพิ่มความมั่นใจก่อนลงสนามสอบจริง \'Pre-Test : Grammar and Structures Episode 1 : Word Building & Word Forms Episode 2 : Parts of Speech Episode 3 : Sentence Structures Episode 4 : Noun, Noun Phrase & Noun Clause Episode 5 : Verb & Verb Agreement Episode 6 : Subject & Verb Agreement Episode 7 : Question Tags Episode 8 : Conditional Sentences (If-Clauses) Episode 9 : Subjunctives Episode 10 : Tenses ฯลฯ', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(18, 'สรุปเคมี มัธยมปลาย (CHEMISTRY FOR HIGH SCHOOL STUD', 'วัฒน สุทธิศิริมงคล และคณะ', 'หนังสือเล่มนี้จึงเหมาะกับนักเรียนสายวิทย์ทุกคนใช้อ่านควบคู่กับหนังสือของโรงเรียน เพื่อเตรียมตัวสอบในทุกสนาม เช่น PAT2 วิชาสามัญ ONET และสอบเก็บคะแนนที่โรงเรียน โดยจะช่วยให้นักเรียนใช้เวลาทบทวนเนื้อหาน้อยที่สุด แต่ได้เนื้อหาครบถ้วนมากที่สุด นอกจากนั้น ท้ายบทของทุกบท ยังมีแนวข้อสอบให้นักเรียนได้ทดลองทำด้วย', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(19, 'เฉลยข้อสอบ เข้ามหาวิทยาลัย ฟิสิกส์ 15 พ.ศ.', 'ดร. จักรินทร์ วรรณโพธิ์กลาง', 'รวบข้อสอบจริงเข้ามหาวิทยาลัยตั้งแต่ปี พ.ศ. 2541-2550 และแนวข้อสอบอิงข้อสอบจริง A-NET PAT 2 และ 9 วิชาสามัญในปีถัดมา พร้อมเฉลยอย่างละเอียดทุกข้อ ใช้เตรียมตัวสอบฟิสิกส์เข้ามหาวิทยาลัยได้ทุกรูปแบบ - ข้อสอบวิชาฟิสิกส์เข้ามหาวิทยาลัย ปี 2541 ครั้งที่ 1 - ข้อสอบวิชาฟิสิกส์เข้ามหาวิทยาลัย ปี 2542 ครั้งที่ 1 - ข้อสอบวิชาฟิสิกส์เข้ามหาวิทยาลัย ปี 2542 ครั้งที่ 2 - ข้อสอบวิชาฟิสิกส์เข้ามหาวิทยาลัย ปี 2543 ครั้งที่ 1 - ข้อสอบวิชาฟิสิกส์เข้ามหาวิทยาลัย ปี 2543 ครั้งที่ 2 - ข้อสอบวิชาฟิสิกส์เข้ามหาวิทยาลัย ปี 2544 ครั้งที่ 1 - ข้อสอบวิชาฟิสิกส์เข้ามหาวิทยาลัย ปี 2544 ครั้งที่ 2 - ข้อสอบวิชาฟิสิกส์เข้ามหาวิทยาลัย ปี 2545 ครั้งที่ 1 - ข้อสอบวิชาฟิสิกส์เข้ามหาวิทยาลัย ปี 2545 ครั้งที่ 2 - ข้อสอบวิชาฟิสิกส์เข้ามหาวิทยาลัย ปี 2546 ครั้งที่ 1 - ข้อสอบวิชาฟิสิกส์เข้ามหาวิทยาลัย ปี 2546 ครั้งที่ 2 ฯลฯ', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(20, 'GAT เชื่อมโยง (อภิมหาคัมภีร์)', 'ดิศธร โรจน์ภัทรกิจ (ติวเตอร์แจ็ค)', 'ถ้าน้อง ๆ กำลังตามหาหนังสือบทความ GAT เชื่อมโยงเอาไว้ฝึกทำให้ได้เต็ม 150 คะแนน แบบชัวร์ ๆ หนังสือ \"GAT เชื่อมโยง\" เล่มนี้ ช่วยได้! เพราะได้บรรจุบทความ GAT เชื่อมโยงมากกว่า 70 บทความ ที่คล้ายกับข้อสอบจริงมากที่สุด ด้วยเทคนิคลับ Master Map โดยแยกบทความเป็นประเภทที่มักออกสอบทุกรูปแบบ พร้อมเฉลยอธิบายอย่างละเอียด เหมาะอย่างยิ่งสำหรับเตรียมความพร้อม ให้มีความมั่นใจในการสอบมากยิ่งขึ้น \'บทที่ 1 สทศ. บอกว่า บทที่ 2 สรุป GAT เชื่อมโยง คือ? บทที่ 3 บอกเล่าประสบการณ์ตรงในห้องสอบ บทที่ 4 8 Step ขั้นเทพ บทที่ 5 เส้นผมบังภูเขา บทที่ 6 ทฤษฎี บทที่ 7 Case Study กำจัดจุดอ่อน บทที่ 8 ทดสอบความจำ A / D / F / 99H บทที่ 9 ซ้อมมือ บทที่ 10 News ฯลฯ', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(21, 'CAMBRIDGE IELTS 16 Academic ', 'CAMBRIDGE UNIVERSITY PRESS', 'Authentic examination papers from Cambridge Assessment English provide perfect practice because they are EXACTLY like the real test. Inside IELTS 16 Academic with Answers with Audio you\'ll find FOUR complete examination papers plus details of the different parts of the test and the scoring system, so you can familiarise yourself with the Academic test format and practise your exam technique. Download the audio for the Listening tests, example Speaking test video, answer keys with extra explanations and sample Writing answers (instructions on inner front cover), or access your audio and video directly via QR codes in the book.', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(22, 'จับตายวายร้าย ภาษาอังกฤษ 9 วิชาสามัญ กสพท', 'สุรชัย รอดงาม (อาจารย์ทีวี จูเนียร์)', '\"จับตายวายร้าย ภาษาอังกฤษ 9 วิชาสามัญ กสพท\" เล่มนี้ เจาะลึกแนวข้อสอบ Entrance ระบบใหม่เข้ามหาวิทยาลัย และการสอบกลุ่มสถาบันแพทยศาสตร์แห่งประเทศไทย (กสพท) ตะลุยโจทย์ 10 ชุด กว่า 500 ข้อ ทั้ง Listening & Speaking, Reading และ Writing รวมถึงแนวข้อสอบเพื่อคัดกรองแพทย์ของ กสพท ไม่ว่าจะเป็นแพทย์โครงการ ODOD แพทย์โครงการ CPIRD แพทย์โครงการ MDX แพทย์โครงการ MDO2 และทันตแพทย์โครงการ DTX มีเฉลยพร้อมคำอธิบายโดยละเอียดข้อต่อข้อ เด็ก ๆ สามารถเข้าใจและเรียนรู้ได้ด้วยตนเอง เหมือนมีติวเตอร์ติดตัวไปทุก ๆ ที่ ยิ่งอ่านยิ่งแม่น ยิ่งฝึกทำยิ่งชำนาญ ช่วยให้เด็ก ๆ เตรียมความพร้อมก่อนลงสนามจริงได้อย่างมั่นใจ', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(23, 'เฉลยข้อสอบเข้ามหาวิทยาลัย คณิตศาสตร์ 15 พ.ศ.', 'ดร. จักรินทร์ วรรณโพธิ์กลาง', 'รวบรวมข้อสอบจริงเข้ามหาวิทยาลัยวิชาคณิตศาสตร์ย้อนหลัง 15 พ.ศ. ตั้งแต่ข้อสอบ A-NET ปี 49-50-51 แนวข้อสอบ PAT 1 อิงข้อสอบจริง 4 ชุด แนวข้อสอบ 9 วิชาสามัญ อิงข้อสอบจริง 2 ชุด พร้อมเฉลยละเอียด ข้อสอบทุกปี เล่มเดียวใช้เตรียมตัวสอบได้ทุกรูปแบบ ข้อสอบระบบเก่าสอบปีละ 2 ครั้ง (ปี 2541-2548) - ข้อสอบเข้ามหาวิทยาลัย ปี 2541 ครั้งที่ 1 - เฉลยข้อสอบเข้ามหาวิทยาลัย ปี 2541 ครั้งที่ 1 - ข้อสอบเข้ามหาวิทยาลัย ปี 2542 ครั้งที่ 1 - เฉลยข้อสอบเข้ามหาวิทยาลัย ปี 2542 ครั้งที่ 1 ฯลฯ ข้อสอบ A-NET (ปี 2549-2550) - แนวข้อสอบคณิตศาสตร์ A-NET ปี 2549 - เฉลยแนวข้อสอบคณิตศาสตร์ A-NET ปี 2549 - แนวข้อสอบคณิตศาสตร์ A-NET ปี 2550 - เฉลยแนวข้อสอบคณิตศาสตร์ A-NET ปี 2550 แนวข้อสอบคณิตศาสตร์ PAT 1 - แนวข้อสอบคณิตศาสตร์ PAT 1 ชุดที่ 1 - เฉลยแนวข้อสอบคณิตศาสตร์ PAT 1 ชุดที่ 1 - แนวข้อสอบคณิตศาสตร์ PAT 1 ชุดที่ 2 - เฉลยแนวข้อสอบคณิตศาสตร์ PAT 1 ชุดที่ 2 ฯลฯ แนวข้อสอบคณิตศาสตร์ 9 วิชาสามัญ - แนวข้อสอบคณิตศาสตร์ 9 วิชาสามัญ ชุดที่ 1 - เฉลยแนวข้อสอบคณิตศาสตร์ 9 วิชาสามัญ ชุดที่ 1 - แนวข้อสอบคณิตศาสตร์ 9 วิชาสามัญ ชุดที่ 2 - เฉลยแนวข้อสอบคณิตศาสตร์ 9 วิชาสามัญ ชุดที่ 2', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(24, 'คู่มือวาดเส้น หุ่นนิ่งพื้นฐาน', 'Wei Wenli (เว่ย เหวินลี่)', 'คู่มือเรียนและเตรียมสอบ สถาปัตยกรรมศาสตร์ ศิลปกรรมศาสตร์ มัณฑนศิลป์ ทัศนศิลป์ เรขศิลป์ จิตรกรรม ประติมากรรม ภาพพิมพ์ วิจิตรศิลป์ ฯลฯ พิเศษ! QR Code คลิปสอนวาดในเล่ม สามารถใช้เป็นคู่มือเรียนและสอบเข้าคณะด้าน \"ศิลปะ\" - ความรู้พื้นฐานทั่วไป - จัดหมวดหมู่ตามรูปร่าง - จัดหมวดหมู่ตามคุณสมบัติ - การจัดวางองค์ประกอบ - \"Wei Wenli\" ผู้เชี่ยวชาญด้านการสอนศิลปะและติวเด็กสอบเข้ามหาวิทยาลัย', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(25, 'พิชิตข้อสอบ Error 550 ข้อ', 'อารยา หงษ์จินดาเกศ', 'รวบรวมเทคนิคการทำข้อสอบ Error Identification และ Sentence Completion ที่สำคัญ แนวข้อสอบที่มักออกบ่อยกว่า 550 ข้อ พร้อมเฉลยข้อสอบและคำอธิบายอย่างละเอียด เทคนิคการจับจุดผิดในข้อสอบ Error พร้อมไวยากรณ์ที่ควรรู้และพบบ่อย เหมาะสำหรับนักเรียน นิสิต นักศึกษา ที่ต้องการพัฒนาทักษะภาษาอังกฤษ เพื่อใช้ในการเรียนและการสอบ บทที่ 1 Let\'s Prepare! - 1.1 การเตรียมความพร้อมในการทำข้อสอบ - 1.2 Preview Test (Error Identification) 30 ข้อ - 1.3 Preview Test (Sentence Completion) 30 ข้อ - 1.4 เฉลยคำตอบ Preview Test บทที่ 2 Let\'s do it! - 2.1 เทคนิคและข้อแนะนำในการทำข้อสอบ Error Identification Exam - 2.2 เทคนิคและข้อแนะนำในการทำข้อสอบ Sentence Completion Exam - 2.3 เฉลยคำตอบ พร้อมคำอธิบาย', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(26, 'จับตาย! วายร้าย Vocab 1,000 ข้อ For All Exams', 'สุรชัย รอดงาม (อาจารย์ทีวี จูเนียร์)', '\"จับตาย! วายร้าย Vocab 1,000 ข้อ For All Exams\" รวมคำศัพท์กว่า 5,000 คำ และสำนวนสุภาษิตอีก 200 สำนวน ที่ออกข้อสอบบ่อยที่สุดจากการสอบประเภทต่าง ๆ ย้อนหลัง 25 ปี พร้อมด้วยแบบฝึกหัดกว่า 1,000 ข้อ ครอบคลุมทุกแนวข้อสอบ VOCAB เรียกได้ว่า เล่มเดียวเอาอยู่! Best Seller - อาจารย์ทีวี จูเนียร์ (สุรชัย รอดงาม) ติวเตอร์ภาษาอังกฤษสุดฮอตประสบการณ์ติวทั่วประเทศ นักเขียนหนังสือชุดติวสอบภาษาอังกฤษ Best Seller', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(27, 'คลังข้อสอบสังคม da\'vance', 'ปิง เจริญศิริวัฒน์', 'จากหนังสือเลยข้อสอบ Entrance ไทย-สังคม ที่ขายดีที่สุดของศูนย์หนังสือจุฬาฯ   ซึ้งขึ้นอันดับ Best Seller   ติดต่อกันนับเดือน   ด้วยมาตรฐานการเฉลยจากสถาบันกวดวิชาดาว้องก์ เที่ยวตรง แม่นยำ ถูกต้อง   หนังสือเล่มนี้จะทำให้นักเรียนเห็นแนวข้อสอบ Entrance   เข้ามหาวิทยาลัยในสถาบันต่าง ๆ   ข้อสอบ O-NET และข้อสอบ A-NET   ที่กำลังเกิดขึ้นในครั้งต่อไป   เพราะรวบรวมแนวข้อสอบและคำตอบที่มีแนวคิดทีเป็นระบบ', 'Knowledge', );
INSERT INTO `listbook` (`id`, `book`, `author`, `title`, `category`, `pic`) VALUES
(28, '100 เรื่องต้องรู้ก่อนโต ร่างกายมนุษย์', 'จารโยดา', 'หนังสือ \"100 เรื่องต้องรู้ก่อนโต ร่างกายมนุษย์\" เล่มนี้ ได้รวบรวม 100 เรื่องสุดอึ้งเกี่ยวกับร่างกายของเรา ที่เด็ก ๆ จะต้องอยากรู้ ไม่ว่าจะเป็น การเคี้ยวและการพูดทำให้หูของเราสะอาด, ทารกจะไม่หายใจจนกว่าจะคลอดออกมา, เคยมีคุณหมอที่อาบน้ำเลือดเพื่อทดลองว่าเลือดจะไม่ทำให้พวกเขาป่วยด้วย และอื่น ๆ อีกมากมาย นำเสนอในรูปแบบ Infographic มีภาพประกอบน่ารัก อธิบายเข้าใจง่าย ซึ่งจะช่วยกระตุ้นการเรียนรู้ให้กับเด็ก ๆ ได้เป็นอย่างดี', 'Knowledge', );

